On the scene came Christ The Lord, not with peace but with a sword.
He strode amid the crumbling halls where quiet hearts were ignored.
With a word, he rent the veils, dividing flesh from soul;
He broke the tables, scattered coins, made crooked places whole.
No tranquil tune he carried then, but music fierce and bright;
The justice of the storm-wracked sea, the candle in the night.
He asked no truce with suffering, nor silent, cautious fear;
He beckoned all to choose the way, to stand, and to draw near.
Between old wounds and hopes unborn, the blade flashed, clear and wild;
He offered grace for courage worn, and judgment for the reviled.
So walks the Lord with burning sword where quiet comfort falls:
To bring the dawn, he breaks the night and answers when fate calls.
